pics:
{'longTextContent': '行为艺术家阿布莫维奇曾经的伴侣乌雷因为癌症治疗并发症去世了，享年76岁。两人曾经一同创作多个作品，爱过，也曾为作品归属分成对簿公堂。

如今，乌雷去世，阿布莫维奇通过工作室发了Instagram，乌雷工作室也在facebook上发了这么一段话，仿佛要穷尽最好的词汇，形容这个被爱过的人:

\xa0"Ulay was incomparable. As a human being and as an artist. The gentlest soul, a giver. A pioneer, a provocateur, an activist, a mentor, a colleague, a friend, a father, a husband, family. A seeker of light. A lover of life. A traveler. A fighter. A brilliant thinker, who has been pushing limits and enduring pain. Selfless and fearless, ethical, elegant, witty. He, who has influenced so many. He will be deeply missed by his family, friends, the art community and the thousands of us, who he has so deeply touched and inspired. He influenced generations of artists and many more to come―his memory and legacy will live on forever through his work and the work of the Ulay Foundation."', 'url_objects': []}

