user:
{'longTextContent': '一周之前，IPFS参加了ETHDvener 丹尼聚会。

这场盛会由高性能隐私区块链 Findora 团队成员、应用加密学小组（Applied Crypto Group) 成员、Bulltetproofs 证明机制提出者 Dan Boneh 与 Benedikt Bünz 联席举办，邀请了包括 Vitalik Buterin、Ben Fisch 等，以及 Facebook、瑞波、Visa 等机构的行业知名人物，可谓是群英汇聚。

会议重点探讨区块链系统中的安全工程和风险管理的方法，探讨通过加密技术的应用、去中心化协议、形式化方法和实证分析等来提高区块链部署中的安全性或降低风险。', 'url_objects': []}

