pic_flag:
{'longTextContent': '受疫情影响Facebook取消年度开发者大会：

北京时间2月28日凌晨消息，Facebook周四宣布，决定取消其年度F8软件开发者大会 ,Facebook还表示探索了其他方法进行发布会，但没有国际开发者参与，开发者大会会让人感觉不恰当 ,Facebook上周还宣布退出3月份在旧金山举行的游戏开发者大会和PAX East游戏展会。

