{'longTextContent': '#ACCA[超话]# 
Real如我这款阿里系app主要还是想着记录最真实的生活 从你注册开始要求上传你真实可辨析的真人头像 到实时拍摄并非相册上传 这个点还有些创新 但总感觉它的操作是Facebook和Soul的结合版 而且有点可有可无的感觉 

有评论说内容很积极 但这个也得看具体的人和平台监管了 具体想追求real 不是一款app怎么做 最重要的是人心 追求真实方面我国外的朋友照片很少p图 可能了解的也不全面 但国内的还是拍照一秒钟 修图一小时 这个可能一时半会不太会达到用户的预期 唯有真正的真实true things could be recorded by a real youhttp://t.cn/A67URsVG', 'url_objects': [{'url_ori': 'http://t.cn/A67URsVG', 'object_id': '3000000041:e583cbbf956f43027daeaa3bc5cbe98a', 'info': {'url_short': 'http://t.cn/A67URsVG', 'url_long': 'https://mp.weixin.qq.com/s/e3zD76n3S574tZX5xuc9fA', 'type': 39, 'result': True, 'title': '', 'description': '', 'last_modified': 1582820869, 'transcode': 0, 'ext_status': 0}, 'object': {'object_id': '3000000041:e583cbbf956f43027daeaa3bc5cbe98a', 'containerid': '', 'object_domain_id': '3000000041', 'object_type': 'webpage', 'safe_status': 1, 'show_status': '11', 'act_status': '0', 'last_modified': 'Fri Feb 28 00:27:49 CST 2020', 'timestamp': 1582820869770, 'uuid': 4476737554481870, 'uuidstr': '4476737554481870', 'activate_status': '0', 'object': {'summary': ' 这款产品名字叫“Real如我”，由新来往团队打造，主打真实社交，目前已在部分城市灰度发布。“来往团队里一直有坚信...', 'image': {'url': 'http://img.t.sinajs.cn/t6/style/images/face/face_card_longwb.png'}, 'url_short': 'http://t.cn/A67URsWU', 'keywords': '', 'area_class': '', 'object_type': 'webpage', 'description': '我们到底向往哪一种“真实”。', 'generator': 'tc.service.weibo.com', 'effect_url': 'https://mp.weixin.qq.com/s/e3zD76n3S574tZX5xuc9fA', 'image_origin': {'url': 'https://mmbiz.qpic.cn/mmbiz_jpg/QicyPhNHD5vYEZOZDCQLI8nA0GSNpT4c0IKjSaP1DJKl5UJPgogiaZ4vpyrK2LkVjSNVuLbEy9jCo9PwTJzqZOEQ/640?wx_fmt=jpeg'}, 'display_name': '阿里系「Real如我」两年磨一剑，但看上去有些用力过猛了', 'priority': 10, 'imglist': False, 'url': 'https://mp.weixin.qq.com/s/e3zD76n3S574tZX5xuc9fA', 'score': '', 'from': 'firehose', 'isMobile': False, 'id': '3000000041:e583cbbf956f43027daeaa3bc5cbe98a', 'class_level2': '', 'class_level1': '', 'ge': True, 'md5': '', 'biz': {'biz_id': '', 'containerid': ''}, 'target_url': 'https://mp.weixin.qq.com/s/e3zD76n3S574tZX5xuc9fA'}}, 'like_count': 0, 'isActionType': False, 'follower_count': 0, 'asso_like_count': 0, 'card_info_un_integrity': False, 'super_topic_status_count': 0, 'super_topic_photo_count': 0, 'search_topic_count': 0, 'search_topic_read_count': 0}, {'url_ori': 'ACCA[超话]', 'object_id': '1022:1008084ce9a1b2a402a5e6476d587279876d88', 'object': {'object_id': '1022:1008084ce9a1b2a402a5e6476d587279876d88', 'containerid': '1008084ce9a1b2a402a5e6476d587279876d88', 'object_domain_id': '1022', 'object_type': 'topic', 'safe_status': 1, 'show_status': '10', 'act_status': '00', 'last_modified': 'Mon Dec 09 19:08:50 CST 2019', 'timestamp': 1575889730144, 'uuid': 3543436933207694, 'uuidstr': '3543436933207694', 'activate_status': '0', 'object': {'summary': 'ACCA，全称特许公认会计师公会(The Association of Chartered Certified Accountants)成立于1904年，是目前世界上领先的专业会计师团体。也是国际上海外学员最多、学员规模发展最快的专业会计师组织。英国立法许可ACCA会员从事审计、投资顾问和破产执行的工作。ACCA会员资格得到欧盟立法以及许多国家公司法的承认。ACCA是国际会计准则委员会(IASC)的创始成员，也是国际会计师联合会(IFAC)的主要成员，1999年2月联合国通过了以ACCA课程大纲为蓝本的《职业会计师专业教育国际大纲》，该大纲将作为世界各地职业会计师考试课程设置的一个衡量基准。ACCA在国内称为"国际注册会计师"，实际上是特许公认会计师公会(The Association Of Chartered Certified Accountants)的缩写，它是英国具有特许头衔的4家注册会计师协会之一，也是当今最知名的国际性会计师组织之一。ACCA资格被认为是"国际财会界的通行证"。许多国家立法许可ACCA会员从事审计、投资顾问和破产执行工作。ACCA在欧洲会计专家协会(FEE)、亚太会计师联合会(CAPA)和加勒比特许会计师协会(ICAC)等会计组织中起着非常重要的作用。', 'image': {'url': 'http://wx1.sinaimg.cn/thumbnail/9b65511fly1fqq56httyaj20i00eigmj.jpg'}, 'topic_tag': 'ACCA,会计,考试,证书', 'presenter_status': '1', 'object_type': 'topic', 'page_type': '6', 'target_url': 'https://huati.weibo.com/162148', 'mobile': {'page_id': '1008084ce9a1b2a402a5e6476d587279876d88', 'card': {'status': '0'}, 'url': {'scheme': 'sinaweibo://pageinfo?pageid=1008084ce9a1b2a402a5e6476d587279876d88&extparam=ACCA', 'name': 'ACCA', 'status': '1'}}, 'display_name': 'ACCA', 'url': 'https://huati.weibo.com/162148', 'tid': '162148', 'short_url': 'http://t.cn/zYVIeEi', 'super': {'super_time': '1510907696'}, 'biz': {'biz_id': '100808', 'containerid': '1008084ce9a1b2a402a5e6476d587279876d88'}, 'action': ['topic_follow'], 'location': '400-2', 'attribute': '0', 'id': '1022:1008084ce9a1b2a402a5e6476d587279