近几年登山的频率越来越高，这片facebook火爆的悬崖雨林，已经被泰国军方管制，他们说这里很少见亚洲人来攀爬，六个小时的山路走下来腿都要断掉了，一边抱怨一边和同伴讨论什么样的生活才算健康，这种大汗淋漓是苦难还是正确，日落时分登顶俯瞰甲米，累并快乐着。

