{'longTextContent': '#FATIII聊八卦##不止飞行#  香港无线电视节目主持人兼歌手「肥妈」Maria Cordero（香港长大的土生葡人）@肥Maria_Cordero 日前在Facebook发表两段影片，说自己经历了一次险象环生的飞行经历，她搭乘的航班在伦敦起飞后遇到鸟击，飞机需要放油后返航伦敦。

